(function($, window, document, undefined) {

    var Calc = function(el){
        this.$el = $(el);
        if (!this.$el.length) return;

        this.$selectWeight = this.$el.find('.s-weight_changer').changerInp();
        this.$selectFrom = this.$el.find('.s-select_from').selectList();
        this.$selectTo = this.$el.find('.s-select_to').selectList();

        this.maxWeight = this.$selectWeight.data('maxWeight');
        this.citysFrom = this.$selectFrom.data('citys');
        this.citysTo = this.$selectTo.data('citys');

        this.$courierCost = this.$el.find('.s-courier');
        this.$pvzCost = this.$el.find('.s-pickup');

        this.$partnerMessage = this.$el.find('.s-partner_couriers');

        this.weight;
        this.cityFrom;
        this.cityTo;

        this.createLists();
        this.bindEvents();
    };

    Calc.prototype = {
        bindEvents: function(){
            this.$el
                .on('paste change', 'input, .s-weight_changer, .s-select_from, .s-select_to', this.calcCosts.bind(this))
                .on('click', '.s-calc', this.calcCosts.bind(this));
        },
        calcCosts: function(){
            this.weight = parseInt(this.$selectWeight.val() || this.$selectWeight.data('value'));
            this.cityFrom = this.$selectFrom.val() || this.$selectFrom.data('value');
            this.cityTo = this.$selectTo.val() || this.$selectTo.data('value');

            var isPartner = this.cityTo && notPartnerDelivery.indexOf(this.cityTo) === -1;
            //this.$partnerMessage[isPartner ? 'show' : 'hide']();
            this.calcEachCourier();
            this.calcEachPvz();
        },
        createLists: function() {
            var i,l,
                selectFromHTML = '',
                selectToHTML = '',
                uniqueCitysArray = [];

            for(i=0,l=this.citysFrom.length; i<l; i+=1) selectFromHTML += '<li class="select_list_i">'+ this.citysFrom[i] +'</li>';

            this.citysTo = window.G.getUniqItems(grastinPvz, grastinCourier, boxberryPvz, boxberryCourier, hermesPvz );
            this.citysTo.sort();
            this.citysTo.unshift("Москва", "Санкт-Петербург", "Нижний Новгород");

            for(i=0,l=this.citysTo.length; i<l; i+=1) selectToHTML += '<li class="select_list_i">'+ this.citysTo[i] +'</li>';

            this.$selectFrom.find('.select_list').html(selectFromHTML);
            this.$selectTo.find('.select_list').html(selectToHTML);
        },
        calcEachPvz: function(){
            var i=0,
                l=PVZTable.length,
                item,
                calcData = [];

            if (!this.cityFrom || !this.cityTo) return;

            for(; i<l; i+=1) {
                calcData.push( this.calcPvz( PVZTable[i] ) );
            }

            calcData = $.grep(calcData, function(item) { return item; }).join('\n');

            this.$pvzCost.html( calcData || '<div class="cost_line cost_title">Не осуществляется</div>' );
        },
        calcPvz: function(partnerData){
            var i=0,
                dataArray = partnerData.data,
                l=dataArray.length,
                item,
                costPvz = 0,
                timeString = '';

            for(; i<l; i+=1) {
                if ( dataArray[i].cityFrom.indexOf(this.cityFrom) > -1 && dataArray[i].cityTo === this.cityTo ) {
                    item = dataArray[i];
                    break;
                }
            }

            if (!item) return '';

            timeString = item.time ? ' за ' + item.time + window.G.numNutation(item.time, [' день', ' дня', ' дней']) : '';

            costPvz = item.kiloCost[this.weight-1] ?
                ('<div class="cost_line' + (partnerData.name === "Grastin" ? ' cost_line_marked' : '') + '"><span class="cost_title">' + partnerData.name + '</span> '  + timeString + ' <span class="cost_sum">' + item.kiloCost[this.weight-1] + ' р.</span></div>'):
                '';

            return costPvz;
        },

        calcEachCourier: function(){
            var i=0,
                l=CourierTable.length,
                item,
                calcData = [];

            if (!this.cityFrom || !this.cityTo) return;

            for(; i<l; i+=1) {
                calcData.push( this.calcCourier( CourierTable[i] ) );
            }

            calcData = $.grep(calcData, function(item) { return item; }).join('\n');

            this.$courierCost.html( calcData || '<div class="cost_line cost_title">Не осуществляется</div>' );
        },
        calcCourier: function(partnerData){
            var i=0,
                dataArray = partnerData.data,
                l=dataArray.length,
                item,
                costCourier = 0,
                timeString = '';

            for(; i<l; i+=1) {
                if ( dataArray[i].cityFrom.indexOf(this.cityFrom) > -1 && dataArray[i].cityTo === this.cityTo ) {
                    item = dataArray[i];
                    break;
                }
            }

            if (!item) return '';

            timeString = item.time ? ' за ' + item.time + window.G.numNutation(item.time, [' день', ' дня', ' дней']) : '';

            costCourier = item.kiloCost[this.weight-1] ?
                ('<div class="cost_line' + (partnerData.name === "Grastin" ? ' cost_line_marked' : '') + '"><span class="cost_title">' + partnerData.name + '</span> ' + timeString + ' <span class="cost_sum">' + item.kiloCost[this.weight-1] + ' р.</span></div>'):
                '';

            return costCourier;
        }
    };




    window.Calc = Calc;

})(jQuery, window, window.document);










