// BIG CALC
(function($, window, document, undefined) {

    var BigCalc = function(el){
        this.$el = $(el);
        if (!this.$el.length) return;

        this.$volumeSizes = this.$el.find('.s-volume_size').changerInp();
        this.$volumeSize = this.$el.find('.s-volume_output');
        this.$weightSize = this.$el.find('.s-weight_size').changerInp();

        this.$deliveryCost = this.$el.find('.s-delivery');
        this.deliveryCost = this.$deliveryCost.data('cost') || 0;
        this.$uploadCost = this.$el.find('.s-upload');
        this.uploadCost = this.$uploadCost.data('cost') || 0;

        this.volume = 0;
        this.weight = 0;

        this.calcCosts();
        this.bindEvents();
    };

    BigCalc.prototype = {
        bindEvents: function(){
            this.$el
                .on('paste change', 'input, .s-volume_size, .s-weight_size', this.calcCosts.bind(this))
                .on('click', '.s-calc', this.calcCosts.bind(this));
        },
        calcCosts: function(){
            var cost = Math.max( this.calcVolume(), this.calcWeight());

            this.$deliveryCost.html( isNaN(cost) ? "Обратитесь к нашим<br/> менеджерам" : (cost + this.deliveryCost) + ' р.');
            this.$uploadCost.html( isNaN(cost) ? "Обратитесь к нашим<br/> менеджерам" : (cost + this.uploadCost) + ' р.');
        },
        calcVolume: function(){
            var volume = 1,
                cost,
                volumeIndex = 0;

            $.each (this.$volumeSizes, function(){
                var $el = $(this);
                volume *= (parseInt($el.val() || $el.data('value')) || 0);
            });

            if (!volume) return 0;
            volume /= 1000000;
            while( overVolTable[volumeIndex].vol < volume ) { volumeIndex += 1;}
            this.$volumeSize.html( (volume < .001 ? "< 0.001" : volume) + ' м<sup>3</sup>');
            return overVolTable[volumeIndex].cost;
        },
        calcWeight: function(){
            var weight = this.$weightSize.val() || this.$weightSize.data('value'),
                weightIndex = 0;

            if (!weight) return 0;
            while( overWeightTable[weightIndex].weight < weight ) { weightIndex += 1;}
            return overWeightTable[weightIndex].cost;
        }
    };




    window.BigCalc = BigCalc;

})(jQuery, window, window.document);










// KAD CALC
(function($, window, document, ymaps, undefined) {

    var KadCalc = function(el){
        this.$el = $(el);
        if (!ymaps || !this.$el.length) return;

        //document.getElementById('city').value;//
        this.$region = this.$el.find('.s-kad_region').selectList();
        //console.log(this.$region.value());

        this.$address = this.$el.find('.s-kad_address');
        this.$address2 = this.$el.find('.s-kad_address2');
        this.$path = this.$el.find('.s-kad_path');
        this.$cost = this.$el.find('.s-kad_cost');

        this.map = null;
        this.route_bef = null;

        this.init();
    };

    KadCalc.prototype = {
        init: function(){
            this.$el
                .on('change', '.s-select_region', this.changeCity.bind(this))
                .on('paste change', 'input, .s-volume_size, .s-weight_size', this.calcCosts.bind(this))
                .on('keydown', '.s-kad_address', this.addressKeydown.bind(this))
                .on('click', '.s-calc', this.showAddress.bind(this));

            //ymaps.ready(this.createMap.bind(this));
            ymaps.ready(this.createMap.bind(this));

        },
        changeCity: function(){
            //this.createMap();

        },
        createMap: function(){
            var _this = this;

            this.map = new ymaps.Map("kadMap", {
                center: mkad_center,
                zoom: 8,
                behaviors: ['default', 'scrollZoom'],
                controls: []
            });
            this.map.controls.add('zoomControl');
            //'smallMapDefaultSet'

            //нарисуем полигон мкада.
            mkad_polygon = new ymaps.Polygon(mkad_coords);
            ymaps.geoQuery(mkad_polygon).addToMap(this.map);

            kad_polygon = new ymaps.Polygon(kad_coords);
            ymaps.geoQuery(kad_polygon).addToMap(this.map);

        },
        addressKeydown: function(e){
            if (e.which === 13) {
                this.showAddress();
            }
        },
        showAddress: function(e) {
            //Установка карты на Москву или Питер
            this.$region = document.getElementById('city').value;//this.$el.find('.s-kad_region').selectList();
            if(this.$region!="spb"){
                sel_minmax=mkad_minmax;
                //console.log("москва");
            } else {
                sel_minmax=kad_minmax;
                //console.log("питер");
            }

            //console.log(ymaps.util.bounds.getCenterAndZoom(sel_minmax));

            var _this = this,
                value = $.trim(this.$address.val());

            if (!value) return false;

            //Если адрес нормальный - пытаемся получить координаты
            ymaps.geocode(value, {
                boundedBy: this.map.getBounds(),
                // strictBounds: true,
                results: 1
            })
                .then(function (res) {
                    var firstGeoObject = res.geoObjects.get(0);
                    if (firstGeoObject) {
                        _this.$address2.removeClass('hide').html( firstGeoObject.properties.get('text') );
                        _this.$path.addClass('hide')
                        _this.createPath(firstGeoObject);
                    } else {
                        _this.clearMap();
                    }
                });
        },
        clearMap: function() {
            if(this.route_bef) {
                this.map.geoObjects.remove(this.route_bef);
            }
        },
        createPath: function(firstGeoObject) {
            if(this.$region!="Санкт-Петербург")
            {
                sel_center=mkad_center;
                sel_polygon=mkad_polygon;
                sel_minmax=mkad_minmax;
                sel_name="МКАД";
                //console.log("москва");
            } else {
                sel_center=kad_center;
                sel_polygon=kad_polygon;
                sel_minmax=kad_minmax;
                sel_name="КАД";
                //console.log("питер");
            }

            this.map.setCenter(sel_center, 7);
            this.map.setBounds(sel_minmax);


            var _this = this,
                coords = firstGeoObject.geometry.getCoordinates(),
                coordsInside = sel_polygon.geometry.contains(coords);

            if (coordsInside) {
                this.clearMap();
                this.route_bef = new ymaps.GeoObject({
                    geometry: {
                        type: "Point",
                        coordinates: coords
                    },
                    properties: {
                        iconContent: firstGeoObject.properties.get('name')
                    }
                }, {
                    preset: 'islands#blackStretchyIcon'
                });

                this.map.geoObjects.add(_this.route_bef);
                this.$cost.html('<div class="costs_title">Пункт назначения находится в пределах МКАД/КАД.</div>');

                return;
            }

            //составляем маршрут между центром полигона и кликом
            //приблизительный центр полигона
            ymaps
                .route([sel_center, coords])
                .then(function (route) {
                    //составляем коллекцию сегментов пути
                    var pathsObjects = ymaps.geoQuery(route.getPaths()),
                        edges = [];

                    _this.clearMap();

                    //переберём сегменты и разобьём их на отрезки-линии
                    pathsObjects.each(function (path) {
                        var coordinates = path.geometry.getCoordinates();
                        for (var i = 1, l = coordinates.length; i < l; i++) {
                            edges.push({
                                type: 'LineString',
                                coordinates: [coordinates[i], coordinates[i - 1]]
                            });
                        }
                    });

                    //добавим эту выборку на карту, но показывать не будем
                    // она нужна только для расчётов
                    var routeObjects = ymaps.geoQuery(edges).setOptions('visible', false).addToMap(_this.map);
                    //находим сегменты, попадающие внутрь мкад
                    var objectsInMoscow = routeObjects.searchInside(sel_polygon),
                        //объекты за пределами МКАД получим исключением полученных выборок из исходной (так проще!).
                        objectsOutMoscow = routeObjects.remove(objectsInMoscow),
                        //находим начальную точку полученной выборки
                        start_coords = objectsOutMoscow.get(0).geometry.getCoordinates()[1];
                    //удаляем расчётный маршрут с карты

                    routeObjects.removeFromMap(_this.map);

                    //строим маршрут от стартовой точки до клика
                    ymaps
                        .route([start_coords, coords])
                        .then(function (needed_route) {
                            //длина маршрута
                            var distance = Math.round(needed_route.getLength()/1000);
                            _this.$path.removeClass('hide').html("Расстояние от "+sel_name+" составляет "+distance+" км.");

                            //Ограничения по длине маршрута
                            if(distance > 100) {
                                _this.map.setCenter(coords, 10);
                                _this.$cost.html('<div class="costs_title">Извините, пункт назначения слишком далеко.</div>');
                                return;
                            }
                            //КАД до 50км по умолчанию
                            else if(sel_name=="КАД" && distance > 50) {
                                _this.map.setCenter(coords, 10);
                                _this.$cost.html('<div class="costs_title">Извините, пункт назначения слишком далеко.</div>');
                                return;
                            };


                            _this.$cost.html('<div class="costs_title">Доплата составит</div><div class="cost_sum_empty"><div class="cost_sum">'+_this.calcCosts(distance)+' р.</div></div>');

                            //подписываем начало и конец маршрута
                            needed_route.getWayPoints().each(function(point){
                                if (point.properties.get('iconContent') == '1') {
                                    point.properties.set('iconContent', sel_name);
                                    point.options.set('preset', 'islands#blackStretchyIcon');
                                }
                                if (point.properties.get('iconContent') == '2') {
                                    point.options.set('preset', 'islands#pinkStretchyIcon');
                                    point.properties.set('iconContent', distance +' км.');

                                }
                                //point.properties.set('visible', false);
                            });

                            _this.map.geoObjects.add(needed_route);
                            needed_route.options.set({ strokeWidth: 5, strokeColor: '80d171f3', opacity: 0.5 });

                            _this.route_bef = needed_route;

                            br=0.01;

                            //sel2=[[sel_minmax[0][0],sel_minmax[0][1]],[sel_minmax[1][0],sel_minmax[1][1]]];
                            sel2=[[start_coords[0]-br,start_coords[1]-br],[start_coords[0]+br,start_coords[1]+br]];

                            if(coords[0]-br<sel2[0][0]) sel2[0][0]=coords[0]-br;
                            if(coords[0]+br>sel2[1][0]) sel2[1][0]=coords[0]+br;

                            if(coords[1]-br<sel2[0][1]) sel2[0][1]=coords[1]-br;
                            if(coords[1]+br>sel2[1][1]) sel2[1][1]=coords[1]+br;

                            _this.map.setBounds(sel2);
                        });
                });
        },
        calcCosts: function(distance){
            //Новый расчет

            if(this.$region!="Санкт-Петербург" && distance > 26) {
                return 330;
            }

            else {
                return Math.ceil(distance/5) * 55;}
        }
    };


    window.KadCalc = KadCalc;

})(jQuery, window, window.document, window.ymaps);



